import React from "react";

let x,y;

function add( x, y){
    return x+y;
}

function multiply( x, y){
return x*y;
}


function subtract( x, y){
    return x-y;
}
function division( x, y){
    return x/y;
}

export default add;
export {multiply,subtract,division};
